<!DOCTYPE html>
<html>
    <head>
    
        <meta charset=\"UTF-8\">
        <title>{% block title %}Welcome!{% endblock %}</title>
        {# Run `composer require symfony/webpack-encore-bundle`
           and uncomment the following Encore helpers to start using Symfony UX #}
        {% block stylesheets %}
            {#{{ encore_entry_link_tags('app') }}#}
            <link rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\" integrity=\"sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T\" crossorigin=\"anonymous\">
            <style>
            .card:hover{
                outline:solid 2px blue;
                cursor:pointer;
            }
            .card{
                color:black;
                text-decoration:none;
            }
            a{
                text-decoration:none;
            }
            img{
                object-fit:cover;
            }
            h1,h2,h3,h4,h5,h6,p{
                color: black;
            }
            </style>
        {% endblock %}

        {% block javascripts %}
            {#{{ encore_entry_script_tags('app') }}#}
        {% endblock %}
        
        
    <body> 
    <nav class=\"navbar navbar-expand-lg navbar-light bg-light\">
            <ul class=\"navbar-nav\">
            <li class=\"nav-item active\">
                <a class=\"nav-link\" href=\"{{ path('index.index')}}\">Accueil <span class=\"sr-only\">(current)</span></a>
            </li>
            <li class=\"nav-item\">
                <a class=\"nav-link\" href=\"{{ path('product.index')}}\">Produits</a>
            </li>
            <li class=\"nav-item\">
                <a class=\"nav-link\" href=\"{{ path('command.index')}}\">Commandes</a>
            </li>
            <li class=\"nav-item\">
                <a class=\"text-white btn btn-primary nav-link\" href=\"{{ path('cart.index')}}\" >Panier</a>
            </li>
            </ul>
        </nav> 
        {% for message in app.flashes('success')%}
        <div class=\"alert alert-success\">
            {{message}}
        </div>
        {% endfor %}

        {% for message in app.flashes('danger')%}
        <div class=\"alert alert-danger\">
            {{message}}
        </div>
        {% endfor %}
        {% block body %}
            

        {% endblock %}
    </body>
</html>
", "base.html.twig", "/app/templates/base.html.twig");
